import { Link } from "react-router-dom";
const NotFound = () => {
  return (
    <div className="d-flex justify-content-center">
      <div className="card">
        <h2>Sorry</h2>
        <p>That page can't be found</p>
        <Link to="/">Back To Home Page</Link>
      </div>
    </div>
  );
};

export default NotFound;
